import * as React from 'react';
import { Box, Button, Container, Grid, Typography, Link, IconButton } from '@mui/material';

const Blog = () => {

    return(
        <Box 
        sx={{height: '100vh', backgroundColor: '#EEEEEE'}}>
            <Typography sx={{marginLeft: '5%', marginTop: '5%'}}>
            Every Sunday I write a blog on what is on my mind.
            </Typography>
         </Box>
    );
}

export default Blog;
